create database if not exists `dbfabrica`;

USE `dbfabrica`;

/*Table structure for table `cliente` */

DROP TABLE IF EXISTS `cliente`;

CREATE TABLE `cliente` (
  `ClienteID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Nome` varchar(256) NOT NULL,
  `Email` varchar(256) DEFAULT NULL,
  `Telefone` varchar(15) DEFAULT NULL,
  `Tipo` char(2) DEFAULT NULL,
  `Ramo` varchar(50) DEFAULT NULL,
  `Rua` varchar(256) DEFAULT NULL,
  `Numero` varchar(7) DEFAULT NULL,
  `Complemento` varchar(100) DEFAULT NULL,
  `Cep` varchar(10) DEFAULT NULL,
  `Bairro` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`ClienteID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `cliente` */

/*Table structure for table `pedido` */

DROP TABLE IF EXISTS `pedido`;

CREATE TABLE `pedido` (
  `PedidoID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `ClienteID` int(10) unsigned NOT NULL,
  `DataPedido` date NOT NULL,
  PRIMARY KEY (`PedidoID`,`ClienteID`),
  KEY `Pedido_FKIndex1` (`ClienteID`),
  CONSTRAINT `pedido_ibfk_1` FOREIGN KEY (`ClienteID`) REFERENCES `cliente` (`ClienteID`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `pedido` */

/*Table structure for table `produto` */

DROP TABLE IF EXISTS `produto`;

CREATE TABLE `produto` (
  `ProdutoID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Nome` varchar(256) NOT NULL,
  `Ingradientes` varchar(500) DEFAULT NULL,
  `Descricao` varchar(500) DEFAULT NULL,
  `Foto` blob,
  `Preco` decimal(8,2) NOT NULL,
  `Estoque` int(4) unsigned NOT NULL,
  `Tipo` varchar(20) NOT NULL,
  PRIMARY KEY (`ProdutoID`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

