  `PedidoID` int(10) unsigned NOT NULL,
  `ProdutoID` int(10) unsigned NOT NULL,
  PRIMARY KEY (`ProdutoXPedidoID`,`PedidoID`,`ProdutoID`),
  KEY `Pedido_has_Produto_FKIndex1` (`PedidoID`),
  KEY `Pedido_has_Produto_FKIndex2` (`ProdutoID`),
  CONSTRAINT `produtoxpedido_ibfk_1` FOREIGN KEY (`PedidoID`) REFERENCES `pedido` (`PedidoID`) ON DELETE NO ACTION ON UPDATE NO ACTION,
